import React from 'react'
import CustomIcon from '../photos/top.svg';
const Header = () => {
  return (
    <div className="flex">
      <div className="mx-10">
        <img src={CustomIcon} alt="Custom Icon" className="w-82px h-92px mt-14px"/> 
      </div>
      <div>
        The school Academics Life @DBTR Contact us 
      </div>
    </div>
  )
}

export default Header
